descricao:
Agosto Lilás - Os Desafios da Aplicação da Lei Maria da Penha
 COM A PARTICIPAÇÃO DA SECRETARIA DA MULHER DA CÂMARA DOS DEPUTADOS.


O Evento integra a campanha Agosto Lilás e comemora os 16 anos da legislação


Participantes Convidadas:


1) LEILA BRANT ASSAF, Coordenadora-Geral de Dados, Informações e Combate, do Departamento de Políticas de Enfrentamento à Violência contra as Mulheres da Secretaria Nacional de Políticas para as Mulheres do Ministério da Mulher, da Família e dos Direitos Humanos; (confirmada)

2) MARIA CRISTIANA ZIOUVA, Assessora de Apoio Interinstitucional do Conselho Nacional de Justiça  - CNJ (confirmada);

3) JULIANA MARTINS, Coordenadora Institucional do Fórum Brasileiro de Segurança Pública - FBSP (confirmada);

4) BEATRIZ ACCIOLY, Coordenadora de Violência contra Mulheres, Pesquisa e Impacto no Instituto Avon (confirmada);

5) DEBORA ALBU, Representante da ONU Mulheres (confirmada).


Requerimento CMulher nº 23/2022, de autoria das Deputadas Tereza Nelma e Vivi Reis.
